import axios from "axios";

const apiKey = "a8ce1029e7856b8a14e6b172318a0f31";

export const pochtaTest = async () => {
  try {
    const { data } = await axios.get("https://api.novaposhta.ua/v2.0/json/", {
      apiKey: apiKey,
      modelName: "Address",
      calledMethod: "searchSettelments",
      calledMethod: "searchSettlements",
      methodProperties: {
        CityName: "київ",
        Limit: "50",
        Page: "2",
      },
    });
    console.log(data);
  } catch (error) {
    console.error("Error fetching data:", error);
  }
};
